import React from "react";
import item1 from "../img/item-1.png";
class TheItem extends React.Component {
  render() {
    return (
      <div className="item">
        <div className="item__image">
          <img src={item1} alt="item"></img>
        </div>
        <div className="item__desc">
          <h4>spreadsheet shirt</h4>
          <h5>24</h5>
        </div>
      </div>
    );
  }
}

export default TheItem;
